.#{$prefix}--#{$charts-prefix}--grid-brush {
	// disable default d3 brush selection
	g.grid-brush {
		rect.selection {
			fill: none;
			fill-opacity: 0;
			stroke: none;
		}
	}
}

g.#{$prefix}--#{$charts-prefix}--grid-brush {
	rect.frontSelection {
		fill: $ui-03;
		fill-opacity: 0.3;
		stroke: $interactive-03;
	}
}

.#{$prefix}--#{$charts-prefix}--grid {
	rect.chart-grid-backdrop {
		@if $carbon--theme == $carbon--theme--g10 {
			fill: $ui-01;
		} @else if $carbon--theme == $carbon--theme--g90 {
			fill: $carbon--gray-100;
		} @else {
			fill: $ui-background;
		}
	}
	rect.chart-grid-backdrop.stroked {
		stroke: $ui-03;
	}

	g.x.grid g.tick,
	g.y.grid g.tick {
		line {
			pointer-events: none;
			stroke-width: 1px;
			stroke: $ui-03;
		}

		&.active line {
			stroke-dasharray: 2px;
			stroke: $focus;
		}
	}
}

.#{$prefix}--#{$charts-prefix}--ruler {
	line.ruler-line {
		@if $ui-background == map-get($carbon--theme--g90, "ui-background") {
			stroke: $carbon--white-0;
		} @else if
			$ui-background ==
			map-get($carbon--theme--g100, "ui-background")
		{
			stroke: $carbon--white-0;
		} @else {
			stroke: $carbon--black-100;
		}

		stroke-width: 1px;
		stroke-dasharray: 2;
		pointer-events: none;
	}
}

