$lines-bg-color: $ui-03;
$lines-shimmer-color: $carbon--white-0;
$areas-bg-color: rgba(127, 127, 127, 0.1);
$areas-shimmer-color: rgba($carbon--white-0, 0.15);

.#{$prefix}--#{$charts-prefix}--skeleton {
	// lines
	rect.chart-skeleton-backdrop {
		@if $carbon--theme == $carbon--theme--g10 {
			fill: $ui-01;
		} @else if $carbon--theme == $carbon--theme--g90 {
			fill: $carbon--gray-100;
		} @else {
			fill: $ui-background;
		}
	}

	.shimmer-effect-lines {
		stroke-width: 1px;
		stroke: url(#shimmer-lines);
	}

	.empty-state-lines {
		stroke-width: 1px;
		stroke: $lines-bg-color;
	}

	#shimmer-lines {
		.stop-bg-shimmer {
			stop-color: $lines-bg-color;
		}

		.stop-shimmer {
			stop-color: $lines-shimmer-color;
		}
	}

	// areas
	.shimmer-effect-areas {
		fill: url(#shimmer-areas);
	}

	.empty-state-areas {
		fill: $areas-bg-color;
	}

	#shimmer-areas {
		.stop-bg-shimmer {
			stop-color: $areas-bg-color;
		}

		.stop-shimmer {
			stop-color: $areas-shimmer-color;
		}
	}
}

g.#{$prefix}--#{$charts-prefix}--legend {
	user-select: none;

	g.legend-item {
		rect.checkbox {
			stroke-width: 1px;
			stroke-opacity: 1;

			&:not(.active) {
				stroke: $text-02;
				fill: $ui-background;
			}

			&:not(.active) ~ g.check {
				display: none;
			}
		}

		rect.hover-stroke {
			fill: none;
			stroke: $carbon--blue-60;
			stroke-width: 2;
		}

		g.check > svg path {
			fill: $ui-background;
			stroke: $ui-background;
		}

		text {
			font-size: 12px;
			fill: $text-02;
		}
	}

	&.clickable g.legend-item:hover {
		cursor: pointer;
	}
}

@import "./../vendor/@carbon/type/scss/type";

.#{$prefix}--#{$charts-prefix}--title text.title {
	fill: $text-01;
	font-size: 16px;
	font-family: carbon--font-family("sans");
	font-weight: carbon--font-weight("semibold");
}

.#{$prefix}--#{$charts-prefix}--meter-title {
	text.meter-title,
	text.percent-value {
		fill: $text-01;
	}

	g.status-indicator {
		&.status--danger circle.status {
			fill: $support-01;
		}

		&.status--warning {
			circle.status {
				fill: $support-03;
			}

			path.innerFill {
				fill: $carbon--black-100;
			}
		}

		&.status--success circle.status {
			fill: $support-02;
		}

		path.innerFill {
			@if $carbon--theme ==
				$carbon--theme--g90 or
				$carbon--theme ==
				$carbon--theme--g100
			{
				fill: $carbon--black-100;
			} @else {
				fill: $carbon--white-0;
			}
		}
	}
}

